// ***************** Timer2A_Init ****************
// Activate Timer2 interrupts to output to DAC periodically
// Inputs:  period in units (1/clockfreq)
//          priority 0 (highest) to 7 (lowest)
// Outputs: none
void Timer2A_Init(uint32_t period, uint32_t priority){uint32_t volatile delay;
  SYSCTL_RCGCTIMER_R |= 0x04;   // 0) activate timer2
  delay = SYSCTL_RCGCTIMER_R;          // Give time to settle
  TIMER2_CTL_R = 0x00000000;    // 1) disable timer2A during setup
  TIMER2_CFG_R = 0x00000000;    // 2) configure for 32-bit mode
  TIMER2_TAMR_R = 0x00000002;   // 3) configure for periodic mode, default down-count settings
  TIMER2_TAILR_R = period-1;    // 4) reload value
  TIMER2_TAPR_R = 0;            // 5) bus clock resolution
  TIMER2_ICR_R = 0x00000001;    // 6) clear timer2A timeout flag
  TIMER2_IMR_R = 0x00000001;    // 7) arm timeout interrupt
  NVIC_PRI5_R = (NVIC_PRI5_R&0x00FFFFFF)|(priority<<29); // priority  
// interrupts enabled in the main program after all devices initialized
// vector number 39, interrupt number 23
  
  TIMER2_CTL_R = 0x00000001;    // 10) enable timer2A
}
void Timer2A_Start(void){
  NVIC_EN0_R = 1<<23;           // 9) enable IRQ 23 in NVIC
	ST7735_SetCursor(10,0);
	ST7735_OutFix(1000);
}
void Wave_Stop(void){
  NVIC_DIS0_R = 1<<23;    // 9) disable IRQ 35 in NVIC
}

void Wave_Init(void){
    // initialize a 11.025kHz Timer2A, and the DAC
	Length = 0;
  Timer2A_Init(80000000/11025, 1);   // 9) disable IRQ 23 NVIC
	DAC_Init();
}
// invoked at 11kHz
void Timer2A_Handler(void){
  TIMER2_ICR_R = TIMER_ICR_TATOCINT;// acknowledge TIMER2A timeout
	if(Length) {
		DAC_Out(*SoundPt/4);
		SoundPt++;
		Length--;
	}
	else {
		Wave_Stop();
	}
}


//******* Wave_Start ************
// This function does not output to the DAC. 
// Rather, it sets a pointer and counter, and then enables the timer interrupt.
// It starts the sound, and the timer ISR does the output
// feel free to change the parameters
// Input: pt is a pointer to an array of DAC outputs
//        count is the length of the array
// Output: none
// special cases: as you wish to implement
void Wave_Start(const uint8_t *pt, uint32_t count){
	Length = count;
	SoundPt = pt;
	Timer2A_Start();
};

